import './Header.css';
import '../';
function Header() {
    return (
        <header>
            <div class="nav-bar">
                <a href="" class="logo"><img src="https://static.remove.bg/remove-bg-web/36b50c4385f75bb65509f63b1e81f99fe2b334fc/assets/start_remove-c851bdf8d3127a24e2d137a55b1b427378cd17385b01aec6e59d5d4b5f39d2ec.png" alt="" /></a>
                <div class="navigation">
                    <div class="nav-items">
                        <i class="uil uil-times nav-close-btn"></i>
                        <a href="/html/home.html"><i class="uil uil-home"></i> Home</a>
                        <a href="/html/catalog.html"><i class="uil uil-compass"></i> Explore</a>
                        <a href=""><i class="uil uil-info-circle"></i> About us</a>
                        <a href="/html/blog.html"><i class="uil uil-document-layout-left"></i> Blog</a>
                        <a href="/html/register-page.html"><i class="uil uil-envelope"></i>Sign in</a>


                    </div>
                </div>
                <i class="uil uil-apps nav-menu-btn"></i>
            </div>

            
        </header>

        
    );
}


export default Header;
